';public static $templatehtml='normal:<!DOCTYPE html> <html lang="en"> <head> <meta http-equiv="Content-Type" content="text/html; charset=UTF-8" /> <title>DBSearchReplace</title> <meta name="description" content="DBSeachReplace provides functionality for commiting search-and-replace-operations on MySQL databases." /> <meta name="keywords" content="dbsr, dbseachreplace, search, replace, database, mysql, serialize" /> <link href="?resource=css/style.css" rel="stylesheet" type="text/css" /> <script type="text/javascript" src="?resource=js/script.js"></script> </head> <body> <h1>DBSR: Database Search and Replace</h1> <p class="version">DBSR version <span class="data-DBSR_version">VERSION</span>, GUI version <span class="data-DBSR_GUI_version">VERSION</span></p> <noscript><p>This page requires JavaScript to work properly!</p></noscript> <div id="container"> <ol> <li> <h2><span>Database connection information</span></h2> <div> <form method="post"> <h2>Database connection information</h2> <p> Enter the connection details for the database server below. </p> <table> <tbody> <tr> <td><label for="db_host">Hostname</label></td> <td><input name="db_host" id="db_host" type="text" class="data-db_host" /></td> </tr> <tr> <td><label for="db_port">Port number</label></td> <td><input name="db_port" id="db_port" type="text" class="data-db_port" /></td> </tr> <tr> <td><label for="db_user">Username</label></td> <td><input name="db_user" id="db_user" type="text" class="data-db_user" /></td> </tr> <tr> <td><label for="db_pass">Password</label></td> <td><input name="db_pass" id="db_pass" type="password" class="data-db_pass" /></td> </tr> <tr> <td><label for="db_name">Database</label></td> <td><input name="db_name" id="db_name" type="text" class="data-db_name autocomplete" /></td> </tr> <tr> <td><label for="db_char">Charset</label></td> <td><input name="db_char" id="db_char" type="text" class="data-db_char autocomplete" /></td> </tr> </tbody> </table> <p> <input type="hidden" name="step" value="1" /> <input type="submit" value="Next" /> </p> <p class="errormessage"></p> </form> </div> </li> <li> <h2><span>Search and replace options</span></h2> <div> <form method="post"> <h2>Search and replace options</h2> <p> You have selected the database "<span class="data-db_name">DATABASE NAME</span>" on <span class="data-db_host">DATABASE HOST</span><span class="data-db_port prefix-colon">:PORT</span>. The connection will use the <span class="data-db_char">DATABASE CHARSET</span> character set. </p> <p> Please enter the search and replaces values in the form below. </p> <table> <thead> <tr> <th>Search for:</th> <th>Replace with:</th> </tr> </thead> <tfoot> <tr> <td colspan="2"> <input type="button" value="+" id="addField" /> <input type="button" value="-" id="removeField" disabled="disabled" /> <span class="note-right" style="float: right;">Note that all values are processed in order and thus may replace preceding values.</span> </td> </tr> </tfoot> <tbody id="srFields"> <tr> <td> <textarea name="search[0]" rows="10" cols="50"></textarea> </td> <td> <textarea name="replace[0]" rows="10" cols="50"></textarea> </td> </tr> </tbody> </table> <p> When searching for a specific string it\'s sometimes useful to enter escaped sequences such as "<code>\\n</code>" or <code>\\x5C</code>".<br /> Checking the box below will make the script interpret all escaped sequences as PHP would in a double-quoted string.<br /> <input type="checkbox" name="escapedvalues" id="escapedvalues" class="data-escapedvalues" /><label for="escapedvalues">Interpret PHP escaped sequences.</label> </p> <p> Case-insensitive search is disabled by default since most databases and filesystems are case-sensitive.<br /> Toggeling this settings might come in handy when running search-and-replace actions for user input.<br /> <input type="checkbox" name="dbsr_caseinsensitive" id="dbsr_caseinsensitive" class="data-dbsr_caseinsensitive" /><label for="dbsr_caseinsensitive">Case-insensitive search.</label> </p> <p> For performance reasons, the script normally only processes rows which contain one or more of the plain search strings.<br /> Checking the box below will make the script process <b>every</b> row in the entire database.<br /> This may be useful when due to serialization the exact search strings do not occour in the database or if using this script to repair currupted serialized strings.<br /> <input type="checkbox" name="dbsr_extensivesearch" id="dbsr_extensivesearch" class="data-dbsr_extensivesearch" /><label for="dbsr_extensivesearch">Run a extended search.</label> </p> <p> <input type="hidden" name="step" value="2" /> <input type="button" value="Previous" class="prev" /> <input type="submit" value="Next" /> </p> <p class="errormessage"></p> </form> </div> </li> <li> <h2><span>Confirmation</span></h2> <div> <form method="post"> <h2>Confirmation</h2> <p> You selected the database "<span class="data-db_name">DATABASE NAME</span>" on <span class="data-db_host">DATABASE HOST</span><span class="data-db_port">:PORT</span>. The connection will use the <span class="data-db_char">DATABASE CHARSET</span> character set. </p> <p>The following strings will be used for search-and-replace:</p> <table> <thead> <tr> <th>Search for:</th> <th>Replace with:</th> </tr> </thead> <tfoot> <tr> <td colspan="2"> <span class="values-switch"> View as <a href="#" class="values-raw">raw values</a>, <a href="#" class="values-escaped">PHP escaped values</a> or <a href="#" class="values-hex">hex values</a> </span> </td> </tr> </tfoot> <tbody class="values-raw html-values_raw"> <tr> <td><code>RAW SEARCH VALUE</code></td> <td><code>RAW REPLACE VALUE</code></td> </tr> </tbody> <tbody class="values-escaped html-values_escaped"> <tr> <td><code>ESCAPED SEARCH VALUE</code></td> <td><code>ESCAPED REPLACE VALUE</code></td> </tr> </tbody> <tbody class="values-hex html-values_hex"> <tr> <td><code>HEX SEARCH VALUE</code></td> <td><code>HEX REPLACE VALUE</code></td> </tr> </tbody> </table> <div class="html-suggestions"></div> <p> Always make a backup of your database before using this script!<br /> If you haven\'t done so yet, do it now! Remember Murphy\'s law! </p> <p> <input type="checkbox" name="confirmed" id="confirmed" /><label for="confirmed">This data is correct.</label> </p> <p> <input type="hidden" name="step" value="3" /> <input type="button" value="Previous" class="prev" /> <input type="submit" value="Start!" /> </p> <p class="errormessage"></p> </form> </div> </li> <li> <h2><span>Results</span></h2> <div> <form method="post"> <h2>Results</h2> <p> <span class="data-result">RESULT</span> occurence(s) found and replaced. </p> <p> <input type="checkbox" name="selfdestruct" id="selfdestruct" disabled="disabled" /><label for="selfdestruct">Delete this script from the server.</label><br /> <input type="submit" value="Restart" /> </p> <p class="errormessage"></p> </form> </div> </li> </ol> </div> </body> </html>';public static $webfonts_SourceCodeProeot='base64: ';public static $webfonts_SourceCodeProotf='base64: ';public static $webfonts_SourceCodeProsvg='normal:<?xml version="1.0" standalone="no"?><!DOCTYPE svg PUBLIC "-//W3C//DTD SVG 1.1//EN" "http://www.w3.org/Graphics/SVG/1.1/DTD/svg11.dtd" ><svg xmlns="http://www.w3.org/2000/svg"><metadata></metadata><defs><font id="source_code_proregular" horiz-adv-x="1228" ><font-face units-per-em="2048" ascent="1638" descent="-410" /><missing-glyph horiz-adv-x="500" /><glyph horiz-adv-x="0" /><glyph horiz-adv-x="682" /><glyph horiz-adv-x="0" /><glyph horiz-adv-x="0" /><glyph unicode="&#xd;" /><glyph unicode=" " /><glyph unicode="!" d="M465 135q0 72 44 114t105 42t105.5 -42t44.5 -114q0 -74 -44 -117t-106 -43q-61 0 -105 43t-44 117zM532 1372h164l-4 -192l-20 -705h-115l-20 705z" /><glyph unicode="&#x22;" d="M268 1407h226l-5 -225l-51 -461h-114l-52 461zM737 1407h226l-5 -225l-51 -461h-114l-52 461z" /><glyph unicode="#" d="M178 418v117h176l39 303h-174v118h187l49 375h108l-47 -375h270l50 375h108l-47 -375h166v-118h-178l-39 -303h176v-117